u=il('<div class="header-section"><div class="hero-block"><div class="w-layout-grid hero-grid"><div id="w-node-e8fded91-ea5f-5913-9d80-cd94b50f794d-23230c4e" class="hero-content-left"><h1 class="hero-title">Harold van Gaal<br></h1><h1 class="hero-subtitle"><sup class="superscript hero-subtitle">Beleggingscoaching</sup></h1><p class="hero-text">Op weg naar financile zekerheid met Harold van Gaal Beleggingscoaching, uw persoonlijke beleggingssparringpartner.</p></div><div class="hero-image"><img src="'+Xc+'" draggable="false" width="468" sizes="(max-width: 767px) 100vw, 467.98614501953125px" class="_0margin"></div></div></div><div class="hero-bg-home-one"></div></div><div class="section"><div class="smart-insurance-bg"></div><div class="block-content"><div class="w-layout-grid grid-content"><img src="'+Zc+'" draggable="false" id="w-node-fcbfa713-38ee-18a0-5f3d-321dec6f271b-23230c4e" sizes="(max-width: 479px) 100vw, (max-width: 767px) 96vw, (max-width: 991px) 91vw, 758.0034790039062px" class="smart-image"><div class="content-right"><div data-w-id="fcbfa713-38ee-18a0-5f3d-321dec6f271d" style="opacity:0;" class="top-line"></div><h2 class="section-title-left">Dienstverlening</h2><p class="paragraph-left">Bent u op zoek naar een toegewijde sparringpartner op het gebied van beleggen, die uw doelen begrijpt? Harold van Gaal, uw persoonlijke beleggingscoach, staat voor u klaar. Met 35 jaar beleggingservaring, bied ik persoonlijke begeleiding om uw beleggingsvaardigheden te verfijnen en uw vertrouwen op te bouwen.<br><br>Geen standaard verhalen, maar op maat gemaakte gesprekken die passen bij uw unieke situatie en doelstellingen. Met geduldige discussies en heldere, begrijpelijke uitleg van zelfs de meest complexe beleggingsoplossingen. Ik help, coach en breng rust zodat u de beste beslissingen kunt nemen om uw beleggingsportefeuille op te bouwen en te onderhouden voor uw financile toekomst. Het verschil tussen coaching en advisering leg ik graag in een persoonlijk gesprek uit.<br><br>Klaar om met een betrouwbare partner de juiste stappen te zetten? Neem vandaag nog contact op met Harold van Gaal Beleggingscoaching en ontdek hoe u uw financile doelen kunt realiseren met een beleggingssparringpartner die echt om uw succes geeft.</p></div></div></div></div><div class="section"><div class="block-content"><div class="w-layout-grid grid-insurance-boxes"><div id="w-node-_803cdee6-7170-55cd-d01d-1870b493a95d-23230c4e" class="pet-insurance-box"><img draggable="false" src="'+Gc+'" height="54" alt="" class="insurance-icon"><h3 class="insurance-title">Persoonlijke begeleiding afgestemd op uw doelen en behoeften</h3><p class="insurance-paragraph">Ondersteuning bij het inrichten en onderhouden van uw unieke portefeuille. Periodiek stemmen we af of u op koers ligt en of bijsturing nodig is.</p></div><div id="w-node-_803cdee6-7170-55cd-d01d-1870b493a963-23230c4e" class="pet-insurance-box"><img draggable="false" src="'+eu+'" height="54" alt="" class="insurance-icon"><h3 class="insurance-title">Periodieke toetsing van uw beleggingsresultaten</h3><p class="insurance-paragraph">Toetsing van de beleggingsresultaten behorende bij de portefeuillesamenstelling en risico-acceptatie. Ook regelmatig een vergelijking met referentie portefeuilles en indices.</p></div><div id="w-node-_803cdee6-7170-55cd-d01d-1870b493a969-23230c4e" class="pet-insurance-box"><img draggable="false" src="'+tu+'" height="54" alt="" class="insurance-icon"><h3 class="insurance-title">Lage kosten</h3><p class="insurance-paragraph">Ik hanteer een transparante kostenstructuur, waardoor u minder beleggingskosten betaalt dan wanneer u zich laat adviseren door een bank-of vermogensbeheerder. U bepaalt zelf bij welke bank u uw effectenrekening en beleggersrekening aanhoudt.</p></div><div id="w-node-_803cdee6-7170-55cd-d01d-1870b493a96f-23230c4e" class="pet-insurance-box"><img draggable="false" src="'+nu+'" height="54" alt="" class="insurance-icon"><h3 class="insurance-title">Begeleiding bij onrustige markten of veranderde persoonlijke omstandigheden</h3><p class="insurance-paragraph">Dichtbij en snel paraat, op de hoogte van de visie van diverse analisten van grootbanken.<br>Ik ben uw klankbord. Ik begeleid u op basis van beleggingsmethodes die ook in roerige tijden hun waarde bewezen hebben.</p></div></div></div></div><div class="footer"><div class="footer-block"><div class="footer-divider"></div><div class="w-layout-grid footer-grid"><div id="w-node-_23a2213f-f1e5-367e-fc87-519567ce2116-67ce2112" class="left-block-footer"><a aria-current="page" class="footer-brand w-inline-block w--current"><img draggable="false" src="'+su+'" width="200" sizes="(max-width: 479px) 100vw, 200.00001525878906px" class="logo"></a></div><div id="w-node-_23a2213f-f1e5-367e-fc87-519567ce212f-67ce2112" class="block-footer"><h5 class="footer-title">Locatie</h5><a class="footer-link">Oud Brandevoort 34</a><a class="footer-link">5706 NE Helmond</a></div><div id="w-node-_8a4e3abe-b427-7231-0eaf-1eefc81c03ae-67ce2112" class="block-footer"><h5 class="footer-title">Informatie</h5><a class="footer-link">KvK: 91905893</a><a class="footer-link">BTW:NL004409258B33</a></div><div id="w-node-_7b6aaf96-4eb2-dc3a-ad6e-d8b687f267cd-67ce2112" class="block-footer"><h5 class="footer-title">Contact</h5><a href="mailto:haroldvangaal@beleggingscoaching.nl" class="footer-link clickable">haroldvangaal@beleggingscoaching.nl</a><a href="tel:6-22862509" class="footer-link clickable">06-22862509</a></div></div><div class="footer-divider"></div></div></div>',4);function lu(e,t){return Xr(),tl(Ie,null,[ou,iu],64)}const cu=so(ru,[["render",lu]]),uu=[{name:"home",path:"/",component:cu},{path:"/:pathMatch(.*)*",redirect:"/"}],au=Vc({history:uc(),routes:uu});Kl(Wl).use(au).mount("#app");
